			ref: 'Alimento',
			type: Schema.Types.ObjectId,
		},
		cantidad: {
			type: Number,
			required: true,
		},
		proteinasDetalleComida: {
			type: Number,
			required: true,
		},
		chsDetalleComida: {
			type: Number,
